import React from 'react';
/** Import components */
import {
  Navbar,
  NavbarBrand,
  Button
} from 'reactstrap';
import { NavLink } from 'react-router-dom';

/** Import assets */
import logo from 'assets/images/logo.jpg';
import './topNav.css';

class TopNav extends React.Component {
  handleLogoutClick(e) {
    this.props.authActions.logout();
  }
  render() {
    // const { name } = this.props.currentUser;
    return (
      <div className="top-nav">
        <Navbar light expand className="shadow-sm bg-white p-0 h-100">
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/`}
            >
                 <img src={logo} alt="ChatMatic" className="top-nav-logo" />
            </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/home`}
            >
             <Button><i className = "fa fa-home"></i>Home</Button>
            </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/exercise`}
            >
             <Button><i className = "fa fa-home"></i> Exercise</Button>
             </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/food`}
            >
             <Button><i className = "fa fa-home"></i> Food</Button>
             </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/supplements`}
            >
                <Button><i className = "fa fa-home"></i> Supplements</Button>
             </NavLink>
          </NavbarBrand>
        </Navbar>
      </div>
    );
  }
}

export default TopNav
